import React from 'react';
import './Body.css'

export default function Item(props){
  return(
      <div>
            <h4 className = "item">{props.Item}: ${props.Price}</h4>
            <p className='count'>{props.Count}</p>
            <button className="pos">+</button>
            <button className="neg">-</button>
      </div>
  )
}
